// src/App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import CadastroForm from './components/CadastroForm';
import UserList from './components/UserList';
import EditUser from './components/EditUser';
import CadastroProduto from './components/CadastroProduto';
import ListaProduto from './components/ListaProduto';
import EditarProduto from './components/EditarProduto';
import Login from './components/Login';

const App = () => {
    const [isAuth, setAuth] = useState(false); // Estado de autenticação

    return (
        <Router>
            <Routes>
                <Route path="/" element={<CadastroForm />} />
                <Route path="/login" element={<Login setAuth={setAuth} />} />
                <Route path="/usuarios" element={<UserList />} />
                <Route path="/editar/:id" element={<EditUser />} />
                <Route path="/produtos" element={isAuth ? <ListaProduto /> : <Navigate to="/login" />} />
                <Route path="/cadastro-produto" element={isAuth ? <CadastroProduto /> : <Navigate to="/login" />} />
                <Route path="/editar-produto/:id" element={isAuth ? <EditarProduto /> : <Navigate to="/login" />} />
            </Routes>
        </Router>
    );
};

export default App;
